.private\":\"<b>Sprzedawcy będący osobami prywatnymi są odpowiedzialni za</b> sprzedaż i wysłanie Ci dokładnie tego przedmiotu lub zrealizowanie dokładnie tej usługi, jakie zostały opisane w ich ogłoszeniu. Jeśli masz jakiekolwiek pytania dotyczące zakupu, sugerujemy bezpośredni kontakt ze sprzedawcą będącym osobą prywatną.\",\"consumer.rights.list.3.pl\":\"<b>Nasz partner płatności jest odpowiedzialny za</b> zapewnienie Ci metody płatności online, a <b>nasi partnerzy zajmujący się dostawą</b> są odpowiedzialni za dostarczenie przedmiotów do Ciebie, jak opisano w ich Regulaminach.\",\"consumer.rights.list.intro\":\"W zakup przedmiotu lub zlecenie usługi na OLX zaangażowanych jest kilka podmiotów. Każdy z nich ma następujące obowiązki:\",\"consumer.rights.more.help\":\"<a>Przejdź do naszego centrum pomocy,</a> aby uzyskać szczegółowe informacje na temat praw konsumenta na OLX.\",\"consumer.rights.postedBy.business\":\"<b>To ogłoszenie dodał przedsiębiorca.</b>\",\"consumer.rights.postedBy.private\":\"<b>To ogłoszenie dodała osoba prywatna.</b>\",\"contact.apply\":\"Aplikuj teraz\",\"contact.cancel\":\"Anuluj\",\"contact.goto\":\"Przejdź do\",\"contact.makeACall\":\"Zadzwoń\",\"contact.message\":\"Wyślij wiadomość\",\"contact.others\":\"Inne:\",\"contact.phone\":\"Zadzwoń / SMS\",\"contact.sendSMS\":\"Wyślij SMS\",\"contact.title\":\"Numer telefonu\",\"courier.label\":\"Przesyłki OLX\",\"cp.candidateDBInviteModal.button.no\":\"Nie Teraz\",\"cp.candidateDBInviteModal.button.yes\":\"Tak, dołączam\",\"cp.candidateDBInviteModal.desc1.desc\":\"Jeśli chcesz znaleźć się w Bazie Kandydatów OLX, możesz dać znać pracodawcom, że jesteś otwarty na nowe propozycje zatrudnienia\",\"cp.candidateDBInviteModal.desc1.header\":\"Twój Profil kandydata wyświetli się wybranym pracodawcom, gdy będą szukali odpowiednich kandydatów do pracy\",\"cp.candidateDBInviteModal.desc2.desc\":\"Możesz w każdej chwili zmienić te ustawienia w Profilu kandydata\",\"cp.candidateDBInviteModal.desc2.header\"
